import { Paper, Table, TableContainer, TableHead, TableRow } from '@mui/material'
import React, { Component } from 'react'

export default class ListaPropostas extends Component {
  render() {
    return (
      <div>
        <TableContainer component={Paper}>
            <Table sx={{minWidth: 700}} arial-aria-label='simple table'>
                <TableHead>
                    <TableRow
                    ></TableRow>
                </TableHead>
            </Table>
        </TableContainer>
      </div>
    )
  }
}
